Posted @withrepost • @biggiebash “ I campioni non si costruiscono in palestra. Si costruiscono dall’interno, partendo da qualcosa che hanno nel profondo: un desiderio, un sogno, una visione. Devono avere l’abilitá e la volontá. Ma la volontá deve essere più forte dell’abilità. “ 
Ph @vincenzotascofotografo 
